import React, { Component } from "react";

function SingleRollResult (name, rolltype, rollstring, basestring, rolltotal) {
  return (
    <div className="rollResults" id="rollResult1">
      <div className="rollDescription" id="rollDescription1">{name} - {rolltype}</div>
      <div className="rollParts" id="rollParts1">{rollstring}</div>
      <div className="rollBase" id="rollBase1">{basestring}</div>
      <div className="rollTotal" id="rollTotal1">{rolltotal}</div>
    </div>
  );
}

export default SingleRollResult;
